import React from "react";

class User extends React.Component {
  render() {
    return (
      <article>
        <h2 className="item__name">{this.props.eachUser.name}</h2>
        <img
          className="item__img"
          src={this.props.eachUser.picture.medium}
          alt={this.props.eachUser.name}
          title={this.props.eachUser.name}
        />
        <h4 className="item__name">{this.props.eachUser.location.city} </h4>
      </article>
    );
  }
}

export default User;
